import React from "react";
import { Link } from "react-router-dom";

const Home = () =>{
    return(
       <React.Fragment>
            <div className="homeForm">
               <body className="homeBody">
                <div className="navbarHome">
                    <Link to="/" className="linksHome">TaskManagementSystem</Link>
                    <a href="#about" className="linksHome">About</a>
           
                    <a href="#contact" className="links">Contact</a>
                </div>
               </body>
            </div>
       </React.Fragment>
          
    )
}
export default Home;
